    .tooltip {

        visibility: hidden;
        opacity: 0.75;
        border-radius: 3px;

        content: " ";
        position: absolute;
        top: 14%;
        right: 100%; /* To the left of the tooltip */

        border-width: 5px;
        border-style: solid;
        border-color: transparent #000 transparent transparent;
    }
